import * as types from './mutation-types'

const mutations = {
	[types.SET_VERBSTATE] (state, verbstate) {
		console.log(state);
		console.log(verbstate);
		state.verbState = verbstate
	},
	[types.SET_TOKEN] (state, token) {
		console.log(state);
		console.log(token);
		state.token = token
	}
}

export default mutations
